  `status` tinyint(4) NOT NULL DEFAULT 0 COMMENT '门店状态',
  `creator` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '创建者',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updater` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '更新者',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `deleted` tinyint(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `tenant_id` int(10) NOT NULL DEFAULT 0 COMMENT '租户编号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '自提门店' ROW_FORMAT = Dynamic;


CREATE TABLE `trade_order`  (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '订单编号',
  `no` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '订单流水号',
  `type` int(11) NOT NULL DEFAULT 0 COMMENT '订单类型',
  `terminal` int(11) NOT NULL COMMENT '订单来源终端',
  `user_id` int(10) UNSIGNED NOT NULL COMMENT '用户编号',
  `user_ip` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '用户 IP',
  `user_remark` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '用户备注',
  `status` int(11) NOT NULL DEFAULT 0 COMMENT '订单状态',
  `product_count` int(11) NOT NULL COMMENT '购买的商品数量',
  `cancel_type` int(11) NULL DEFAULT NULL COMMENT '取消类型',
  `remark` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '商家备注',
  `comment_status` tinyint(1) NOT NULL DEFAULT b'0' COMMENT '是否评价',
  `brokerage_user_id` int(10) NULL DEFAULT NULL COMMENT '推广人编号',
  `pay_order_id` int(10) NULL DEFAULT NULL COMMENT '支付订单编号',
  `pay_status` tinyint(1) NOT NULL DEFAULT b'0' COMMENT '是否已支付：[0:未支付 1:已经支付过]',
  `pay_time` datetime(0) NULL DEFAULT NULL COMMENT '订单支付时间',
  `pay_channel_code` varchar(16) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '支付成功的支付渠道',
  `finish_time` datetime(0) NULL DEFAULT NULL COMMENT '订单完成时间',
  `cancel_time` datetime(0) NULL DEFAULT NULL COMMENT '订单取消时间',
  `total_price` int(11) NOT NULL DEFAULT 0 COMMENT '商品原价（总），单位：分',
  `discount_price` int(11) NOT NULL DEFAULT 0 COMMENT '订单优惠（总），单位：分',
  `delivery_price` int(11) NOT NULL DEFAULT 0 COMMENT '运费金额，单位：分',
  `adjust_price` int(11) NOT NULL DEFAULT 0 COMMENT '订单调价（总），单位：分',
  `pay_price` int(11) NOT NULL DEFAULT 0 COMMENT '应付金额（总），单位：分',
  `delivery_type` tinyint(4) NOT NULL COMMENT '配送类型',
  `logistics_id` int(10) NULL DEFAULT NULL COMMENT '发货物流公司编号',
  `logistics_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '物流公司单号',
  `delivery_time` datetime(0) NULL DEFAULT NULL COMMENT '发货时间',
  `receive_time` datetime(0) NULL DEFAULT NULL COMMENT '收货时间',
  `receiver_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '收件人名称',
  `receiver_mobile` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '收件人手机',
  `receiver_area_id` int(11) NULL DEFAULT NULL COMMENT '收件人地区编号',
  `receiver_detail_address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '收件人详细地址',
  `pick_up_store_id` int(10) NULL DEFAULT NULL COMMENT '自提门店编号',
  `pick_up_verify_code` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '自提核销码',
  `refund_status` tinyint(4) NOT NULL DEFAULT 0 COMMENT '售后状态',
  `refund_price` int(11) NOT NULL DEFAULT 0 COMMENT '退款金额，单位：分',
  `coupon_id` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '优惠劵编号',
  `coupon_price` int(11) NOT NULL DEFAULT 0 COMMENT '优惠劵减免金额，单位：分',
  `use_point` int(11) NOT NULL DEFAULT 0 COMMENT '使用的积分',
  `point_price` int(11) NOT NULL DEFAULT 0 COMMENT '积分抵扣的金额',
  `give_point` int(11) NOT NULL DEFAULT 0 COMMENT '赠送的积分',
  `refund_point` int(11) NOT NULL DEFAULT 0 COMMENT '退还的使用的积分',
  `vip_price` int(11) NOT NULL DEFAULT 0 COMMENT 'VIP 减免金额，单位：分',
  `give_coupon_template_counts` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '赠送的优惠劵',
  `give_coupon_ids` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '赠送的优惠劵编号',
  `seckill_activity_id` int(10) NULL DEFAULT NULL COMMENT '秒杀活动编号',
  `bargain_activity_id` int(10) NULL DEFAULT NULL COMMENT '砍价活动编号',
  `bargain_record_id` int(10) NULL DEFAULT NULL COMMENT '砍价记录编号',
  `combination_activity_id` int(10) NULL DEFAULT NULL COMMENT '拼团活动编号',
  `combination_head_id` int(10) NULL DEFAULT NULL COMMENT '拼团团长编号',
  `combination_record_id` int(10) NULL DEFAULT NULL COMMENT '拼团记录编号',
  `point_activity_id` int(10) NULL DEFAULT NULL COMMENT '积分活动编号',
  `creator` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '创建者',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updater` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '更新者',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `deleted` tinyint(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `tenant_id` int(10) NOT NULL DEFAULT 0 COMMENT '租户编号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 277 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '交易订单表' ROW_FORMAT = Dynamic;


CREATE TABLE `trade_order_item`  (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '订单项编号',
  `user_id` int(10) UNSIGNED NOT NULL COMMENT '用户编号',
  `order_id` int(10) UNSIGNED NOT NULL COMMENT '订单编号',
  `cart_id` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '购物车项编号',
  `spu_id` int(10) UNSIGNED NOT NULL COMMENT '商品 SPU 编号',
  `spu_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '商品 SPU 名称',
  `sku_id` int(10) UNSIGNED NOT NULL COMMENT '商品 SKU 编号',
  `properties` varchar(2000) NULL COMMENT '商品属性数组，JSON 格式',
  `pic_url` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '商品图片',
  `count` int(11) NOT NULL COMMENT '购买数量',
  `comment_status` tinyint(1) NOT NULL DEFAULT b'0' COMMENT '是否评价',
  `price` int(11) NOT NULL DEFAULT 0 COMMENT '商品原价（单），单位：分',
  `discount_price` int(11) NOT NULL DEFAULT 0 COMMENT '商品级优惠（总），单位：分',
  `delivery_price` int(11) NOT NULL DEFAULT 0 COMMENT '运费金额，单位：分',
  `adjust_price` int(11) NOT NULL DEFAULT 0 COMMENT '订单调价（总），单位：分',
  `pay_price` int(11) NOT NULL DEFAULT 0 COMMENT '子订单实付金额（总），不算主订单分摊金额，单位：分',
  `coupon_price` int(11) NOT NULL DEFAULT 0 COMMENT '优惠劵减免金额，单位：分',
  `point_price` int(11) NOT NULL DEFAULT 0 COMMENT '积分抵扣的金额',
  `use_point` int(11) NOT NULL DEFAULT 0 COMMENT '使用的积分',
  `give_point` int(11) NOT NULL DEFAULT 0 COMMENT '赠送的积分',
  `vip_price` int(11) NOT NULL DEFAULT 0 COMMENT 'VIP 减免金额，单位：分',
  `after_sale_id` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '售后订单编号',
  `after_sale_status` int(11) NOT NULL DEFAULT 0 COMMENT '售后状态',
  `creator` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '创建者',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updater` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '更新者',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `deleted` tinyint(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `tenant_id` int(10) NOT NULL DEFAULT 0 COMMENT '租户编号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 272 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '交易订单明细表' ROW_FORMAT = Dynamic;


CREATE TABLE `trade_order_log`  (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '日志主键',
  `user_id` int(10) NOT NULL COMMENT '用户编号',
  `user_type` tinyint(4) NOT NULL DEFAULT 0 COMMENT '用户类型',
  `order_id` int(10) NOT NULL COMMENT '订单号',
  `before_status` tinyint(4) NULL DEFAULT NULL COMMENT '操作前状态',
  `after_status` tinyint(4) NULL DEFAULT NULL COMMENT '操作后状态',
  `operate_type` int(11) NOT NULL DEFAULT 0 COMMENT '操作类型',
  `content` varchar(2000) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '操作内容',
  `creator` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '创建者',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updater` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '更新者',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `deleted` tinyint(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `tenant_id` int(10) NOT NULL DEFAULT 0 COMMENT '租户编号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8864 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '交易订单日志' ROW_FORMAT = Dynamic;


CREATE TABLE `trade_statistics`  (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '编号，主键自增',
  `time` datetime(0) NOT NULL COMMENT '统计日期',
  `order_create_count` int(11) NOT NULL DEFAULT 0 COMMENT '创建订单数',
  `order_pay_count` int(11) NOT NULL DEFAULT 0 COMMENT '支付订单商品数',
  `order_pay_price` int(11) NOT NULL DEFAULT 0 COMMENT '总支付金额，单位：分',
  `after_sale_count` int(11) NOT NULL DEFAULT 0 COMMENT '退款订单数',
  `after_sale_refund_price` int(11) NOT NULL DEFAULT 0 COMMENT '总退款金额，单位：分',
  `brokerage_settlement_price` int(11) NOT NULL DEFAULT 0 COMMENT '佣金金额（已结算），单位：分',
  `wallet_pay_price` int(11) NOT NULL DEFAULT 0 COMMENT '总支付金额（余额），单位：分',
  `recharge_pay_count` int(11) NOT NULL DEFAULT 0 COMMENT '充值订单数',
  `recharge_pay_price` int(11) NOT NULL DEFAULT 0 COMMENT '充值金额，单位：分',
  `recharge_refund_count` int(11) NOT NULL DEFAULT 0 COMMENT '充值退款订单数',
  `recharge_refund_price` int(11) NOT NULL DEFAULT 0 COMMENT '充值退款金额，单位：分',
  `creator` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '创建者',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updater` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '更新者',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `deleted` tinyint(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `tenant_id` int(10) NOT NULL DEFAULT 0 COMMENT '租户编号',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `trade_statistics_time_index`(`time`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 153 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '交易统计表' ROW_FORMAT = Dynamic;


SET FOREIGN_KEY_CHECKS = 1;
